import React, { useEffect, useState } from "react";
import axios from "axios";
import { Bar, Doughnut } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  Tooltip,
  Legend
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  Tooltip,
  Legend
);

export default function FinanceiroDashboard() {
  const [dados, setDados] = useState(null);

  useEffect(() => {
    axios.get("http://localhost:8000/api/financeiro")
      .then(res => setDados(res.data))
      .catch(err => console.error(err));
  }, []);

  if (!dados) return <p style={{ textAlign: "center" }}>Carregando...</p>;

  /* ================== GRÁFICOS ================== */

  const topMedicosData = {
    labels: dados.topMedicosExames.map(m => m.medico),
    datasets: [
      {
        label: "Quantidade de Exames",
        data: dados.topMedicosExames.map(m => m.quantidade),
        backgroundColor: [
          "#1976d2",
          "#388e3c",
          "#f57c00",
          "#7b1fa2",
          "#c62828"
        ]
      }
    ]
  };

  const faturamentoConvenioData = {
    labels: dados.faturamentoConvenio.map(c => c.natureza),
    datasets: [
      {
        data: dados.faturamentoConvenio.map(c => c.faturamento),
        backgroundColor: [
          "#4caf50",
          "#2196f3",
          "#ff9800",
          "#9c27b0"
        ]
      }
    ]
  };

  return (
    <div style={{ maxWidth: 1100, margin: "auto", padding: 20 }}>
      <h1 style={{ textAlign: "center" }}>
        Painel Financeiro e Produtividade
      </h1>

      {/* ================== KPIs ================== */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-around",
          margin: "40px 0"
        }}
      >
        <KPI titulo="Receita Procedimentos" valor={dados.receita.procedimentos} />
        <KPI titulo="Receita Diárias" valor={dados.receita.diarias} />
        <KPI titulo="Receita Total" valor={dados.receita.total} />
      </div>

      {/* ================== GRÁFICOS ================== */}
      <div style={{ display: "flex", gap: 40, justifyContent: "center" }}>
        <div style={{ width: 450 }}>
          <h3 style={{ textAlign: "center" }}>
            Top 5 Médicos que mais solicitaram exames
          </h3>
          <Bar data={topMedicosData} />
        </div>

        <div style={{ width: 350 }}>
          <h3 style={{ textAlign: "center" }}>
            Faturamento por Convênio
          </h3>
          <Doughnut data={faturamentoConvenioData} />
        </div>
      </div>

      {/* ================== TABELA ================== */}
      <h3 style={{ marginTop: 50 }}>Top Médicos (Detalhado)</h3>
      <table width="100%" border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Médico</th>
            <th>Quantidade de Exames</th>
            <th>Custo Total</th>
          </tr>
        </thead>
        <tbody>
          {dados.topMedicosExames.map((m, i) => (
            <tr key={i}>
              <td>{m.medico}</td>
              <td>{m.quantidade}</td>
              <td>R$ {Number(m.custo_total).toFixed(2)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

function KPI({ titulo, valor }) {
  return (
    <div
      style={{
        padding: 20,
        borderRadius: 8,
        background: "#f5f5f5",
        minWidth: 220,
        textAlign: "center"
      }}
    >
      <h3>{titulo}</h3>
      <h2>R$ {Number(valor).toFixed(2)}</h2>
    </div>
  );
}
